import React, { Component } from 'react';
import { BrowserRouter as Router, Route} from "react-router-dom";
export default class Link extends Component {
  render() {
    return ( <div>
    <ul>
      <li><Link to="/about">about</Link></li>
      <li><Link to="/home">home</Link></li>
    </ul>
  </div>)
  }
}
